using System;

namespace IntroCompetitiveProgrammingCodes.Day_26
{
    class IsSubsequence
    {
        static void Main(string[] args)
        {
            string a = "leeeeetcode";
            string b = "";

            Console.WriteLine(CheckSubsequence(a, b));

            Console.ReadKey();
        }

        public static bool CheckSubsequence(string s, string t)
        {
            int index = 0;

            for(int i=0; i<s.Length; i++)
            {
                char c = s[i];

                while (index < t.Length && t[index] != c)
                    index++;

                if (index++ == t.Length)
                    return false;
            }

            return true;
        }
    }
}
